            //"[{0} , {1}]: ",
            // sourceNode,
            //destinationNode);

            var path = DijkstraWithoutQueue.DijkstraAlgorithm(graph, sourceNode, destinationNode);

            if (path == null)
            {
                string SqlUpdate1 = "UPDATE KTYP..KTYP_FULL_SHORTEST_PATH SET Shortest_Path='No Path' ,Distance=" + 0 + "WHERE Nodes_I =" + sourceNode + " and Nodes_J=" + destinationNode + "";
